import React from 'react'
import { Button, Form } from 'react-bootstrap'

import data from '../Utils/data.json'

const Home = () => {
  return (
    <div>
      <div>
        {
          <Form>
            {data.questions.map((question) => (
              <h1 key={question}>{question}</h1>
            ))}
            <Button variant='primary' type='submit'>
              Submit
            </Button>
          </Form>
        }
      </div>
    </div>
  )
}

export default Home
